             </div> : "" }
        </div>
        <div id="title"><button id="show-table" onClick={handleShowTable}>{show ? "Sakrij poredak" : "Prikaži poredak"}</button></div>
        {show ? <>
        <div id="title">POREDAK NA TABLICI</div>
        <div className='container'>
            <table>
